import styled from 'styled-components';

export const Landing = styled.div`
width: 100vw;
height: 100vh;
background: linear-gradient(to top, #000, #333);
display: flex;
justify-content: center;
align-items: center;
& button{
    background: transparent;
    border: none;
    position: relative;
    cursor: pointer;
    &:hover{
        filter: brightness(.7);
    }
    &:active{
        filter: brightness(.4);
    }
    & img{
        width: 10rem;
    }
    & p {
        position: absolute;
        top: 10%;
        left: 22%;
    }
}
`
